--
-- Structure de la vue `interventiontypebyinstallateur`
--
DROP TABLE IF EXISTS `interventiontypebyinstallateur`;

CREATE ALGORITHM=UNDEFINED DEFINER=`opentech_oms`@`localhost` SQL SECURITY DEFINER VIEW `interventiontypebyinstallateur`  AS  select `p`.`first_name` AS `first_name`,(select count(0) from (`details_intervention` `di2` left join `interevention` `i2` on((`i2`.`id` = `di2`.`id_intervention`))) where ((`i2`.`id_instalateur` = `i`.`id_instalateur`) and (`di2`.`type` = 'i') and (`i2`.`intervened_at` = `i`.`intervened_at`))) AS `instalation`,(select count(0) from (`details_intervention` `di2` left join `interevention` `i2` on((`i2`.`id` = `di2`.`id_intervention`))) where ((`i2`.`id_instalateur` = `i`.`id_instalateur`) and (`di2`.`type` = 'd') and (`i2`.`intervened_at` = `i`.`intervened_at`))) AS `desinstallation`,(select count(0) from (`details_intervention` `di2` left join `interevention` `i2` on((`i2`.`id` = `di2`.`id_intervention`))) where ((`i2`.`id_instalateur` = `i`.`id_instalateur`) and (`di2`.`type` = 'r') and (`i2`.`intervened_at` = `i`.`intervened_at`))) AS `reconfiguration`,(select count(0) from (`details_intervention` `di2` left join `interevention` `i2` on((`i2`.`id` = `di2`.`id_intervention`))) where ((`i2`.`id_instalateur` = `i`.`id_instalateur`) and (`di2`.`type` = 'v') and (`i2`.`intervened_at` = `i`.`intervened_at`))) AS `verification`,`i`.`intervened_at` AS `intervened_at` from ((`details_intervention` `di` left join `interevention` `i` on((`i`.`id` = `di`.`id_intervention`))) join `personals` `p` on((`p`.`id` = `i`.`id_instalateur`))) where ((`di`.`type` is not null) and (`i`.`id_instalateur` > 0)) group by `i`.`intervened_at`,`p`.`first_name` ;

