--
-- Structure de la vue `list_box_view`
--
DROP TABLE IF EXISTS `list_box_view`;

CREATE ALGORITHM=UNDEFINED DEFINER=`opentech_oms`@`localhost` SQL SECURITY DEFINER VIEW `list_box_view`  AS  select `p`.`id` AS `id`,`p`.`imei_product` AS `imei_product`,`p`.`label` AS `label`,`p`.`model` AS `model`,`p`.`enabled_date` AS `enabled_date`,`p`.`state` AS `state`,`p`.`status` AS `status`,`p`.`movement_id` AS `movement_id`,`p`.`user_id` AS `user_id`,`p`.`observtion` AS `observtion`,`p`.`created_at` AS `created_at`,`p`.`updated_at` AS `updated_at`,`m`.`provider` AS `provider`,`m`.`date_arrived` AS `date_arrived`,`m`.`order_ref` AS `order_ref`,`m`.`category_id` AS `category_id`,`v`.`imei` AS `imei_vehicle`,`per`.`first_name` AS `first_name`,`per`.`id` AS `personal_id`,`ip`.`created_at` AS `date_affectation`,`ip`.`status` AS `ipstatus`,(select `p2`.`label` from (`products` `p2` join `details_intervention` `di2` on((`di2`.`imei_carte` = `p2`.`id`))) where ((`di2`.`imei_boitier` = `di`.`imei_boitier`) and (`di2`.`id_intervention` = `di`.`id_intervention`) and (`di2`.`id` = `di`.`id`))) AS `imei_product_inverse`,`di`.`sim_costumer` AS `costumer_product` from ((((((`products` `p` left join `movements` `m` on((`p`.`movement_id` = `m`.`id`))) left join `inventory_personals` `ip` on(((`ip`.`product_id` = `p`.`id`) and (`ip`.`status` <> '3')))) left join `details_intervention` `di` on((`di`.`imei_boitier` = `p`.`id`))) left join `interevention` `i` on((`i`.`id` = `di`.`id_intervention`))) left join `vehicles` `v` on((`v`.`id` = `di`.`id_vehicule`))) left join `personals` `per` on((`per`.`id` = `ip`.`personal_id`))) where (`m`.`category_id` = 1) ;

-- --------------------------------------------------------

--
-- Structure de la vue `list_card_view`
--
DROP TABLE IF EXISTS `list_card_view`;

CREATE ALGORITHM=UNDEFINED DEFINER=`opentech_oms`@`localhost` SQL SECURITY DEFINER VIEW `list_card_view`  AS  select `p`.`id` AS `id`,`p`.`imei_product` AS `imei_product`,`p`.`label` AS `label`,`p`.`model` AS `model`,`p`.`enabled_date` AS `enabled_date`,`p`.`state` AS `state`,`p`.`status` AS `status`,`p`.`movement_id` AS `movement_id`,`p`.`user_id` AS `user_id`,`p`.`observtion` AS `observtion`,`p`.`created_at` AS `created_at`,`p`.`updated_at` AS `updated_at`,`m`.`provider` AS `provider`,`m`.`date_arrived` AS `date_arrived`,`m`.`order_ref` AS `order_ref`,`m`.`category_id` AS `category_id`,`v`.`imei` AS `imei_vehicle`,`per`.`first_name` AS `first_name`,`per`.`id` AS `personal_id`,`ip`.`created_at` AS `date_affectation`,`ip`.`status` AS `ipstatus`,(select `p2`.`imei_product` from (`products` `p2` join `details_intervention` `di2` on((`di2`.`imei_boitier` = `p2`.`id`))) where ((`di2`.`imei_carte` = `di`.`imei_carte`) and (`di2`.`id_intervention` = `di`.`id_intervention`) and (`di2`.`id` = `di`.`id`))) AS `imei_product_inverse`,`di`.`box_costumer` AS `costumer_product` from ((((((`products` `p` left join `movements` `m` on((`p`.`movement_id` = `m`.`id`))) left join `inventory_personals` `ip` on(((`ip`.`product_id` = `p`.`id`) and (`ip`.`status` <> '3')))) left join `details_intervention` `di` on((`di`.`imei_carte` = `p`.`id`))) left join `interevention` `i` on((`i`.`id` = `di`.`id_intervention`))) left join `vehicles` `v` on((`v`.`id` = `di`.`id_vehicule`))) left join `personals` `per` on((`per`.`id` = `ip`.`personal_id`))) where (`m`.`category_id` = 2) ;

