--
-- Structure de la vue `stock_personnel_view`
--
DROP TABLE IF EXISTS `stock_personnel_view`;

CREATE ALGORITHM=UNDEFINED DEFINER=`opentech_oms`@`localhost` SQL SECURITY DEFINER VIEW `stock_personnel_view`  AS  select `p`.`id` AS `id`,`p`.`first_name` AS `first_name`,`p`.`last_name` AS `last_name`,`p`.`phone_number` AS `phone_number`,`p`.`created_at` AS `created_at`,`p`.`updated_at` AS `updated_at`,`p`.`fonction` AS `fonction`,(select count(0) from ((`inventory_personals` `ip` join `products` `pr` on((`pr`.`id` = `ip`.`product_id`))) join `movements` `m` on((`m`.`id` = `pr`.`movement_id`))) where ((`m`.`category_id` = 1) and (`ip`.`personal_id` = `p`.`id`) and (`ip`.`status` = '1'))) AS `nombreboitier`,(select count(0) from ((`inventory_personals` `ip` join `products` `pr` on((`pr`.`id` = `ip`.`product_id`))) join `movements` `m` on((`m`.`id` = `pr`.`movement_id`))) where ((`m`.`category_id` = 2) and (`ip`.`personal_id` = `p`.`id`) and (`ip`.`status` = '1'))) AS `nombregsm` from `personals` `p` ;

